function aboutMe() {
    //  This is an experiment to build a very simple browser
    //  using the current code base.  Here are some goals...
    //      to show a truly useful app in one page of code
    //      to find out if a module-naive browser is useful
    //      to explore development using only page-local changes
    //          thus enabling development without needing to install
    //      to couple this with changeSets for sharing
    //      to explore app construction by dropping widgets
    //          on a panel that does auto-docking as follows...
    //              all widgets get connected to the panel
    //              all app code is in the panel
    //      to experiment with shared convenience in gridding,
    //          border widths and other uniform styling
    //      to experiment with automatic derivation of buildView
    //          from a concrete (DnD) layout
    //  Scipting of this object began with
    //      new lively.morphic.WindowedApp().openIn($world)
}

