function buildView(extent) {  // this.buildView()
    // Disassemble prior view if present and set extent if not null
    this.restart(extent);

    // Lay out new widgets
	lively.morphic.Panel.makePanedPanel(extent, [
		['functionContainerKindPane', this.newDropDownListPane, new Rectangle(0, 0, 0.5, 0.05)],
		['functionContainerPane', this.newListPane, new Rectangle(0, 0.05, 0.5, 0.55)],
		['functionKindPane', this.newDropDownListPane, new Rectangle(0.5, 0, 0.5, 0.05)],
		['functionPane', this.newListPane, new Rectangle(0.5, 0.05, 0.5, 0.55)],
		['codePane', this.newCodePane, new Rectangle(0, 0.6, 1, 0.4)],
	], this);

    // Connect widgets to this panel as model
    connect(this.functionContainerKindPane, "selection", this, "setFunctionContainerKind", {});
    connect(this.functionContainerPane, "selection", this, "setFunctionContainer", {});
    connect(this.functionKindPane, "selection", this, "setFunctionKind", {});
    connect(this.functionPane, "selection", this, "setFunction", {});

    // Initialize this panel as model
    this.onLoad();
}

