function setFunctionContainer(aContainer) {
    this.selectedContainer = aContainer;
    if(!aContainer) {
        this.functionKindPane.setList([]);
        return;
    }
    var actual = this.selectedContainerKind.actualContainer(aContainer);
    var staticNames = this.selectedContainerKind.functionNamesGetter(actual);
    var categories = [];
    if(staticNames.length > 0)
        categories.push({string: 'default category - static', names: staticNames.sort()});
    if(actual instanceof Function && actual.prototype.constructor === actual) {
        var allProtoNames = this.selectedContainerKind.functionNamesGetter(actual.prototype);
        if(allProtoNames.length > 0) {
            var categoriesObject = aContainer.categories;
            if(categoriesObject) {
                Object.keys(categoriesObject).each(function(e){
                    var names = categoriesObject[e].intersect(allProtoNames);
                    if(names.length > 0) {
                        names.each(function(n){allProtoNames.remove(n)});
                        categories.push({string: e + ' - proto', names: names.sort()});
                    }
                })
            if(allProtoNames.length > 0)
                categories.push({string: 'default category - proto', names: allProtoNames.sort()});
            }
        }
    }
    this.functionKindPane.setList(categories);
    if(categories.length > 0)
        this.functionKindPane.selectAt(0);
}

