function setFunctionKind(aCategory) {
    var target, names;
    var actual = this.selectedContainer && this.selectedContainerKind.actualContainer(this.selectedContainer);
    if(!aCategory) {
        target = this.selectedContainer || Global;
        names = [];
    } else if(aCategory.string == 'default category - static') {
        target = actual;
        names = aCategory.names;
    }
    else {
        target = actual.prototype;
        names = aCategory.names;
    }
    this.functionPane.setList(names.collect(function(e){return {string: e, func: target[e]}}));
    this.codePane.doitContext = target;
    this.owner.setTitle(this.titleFor(this.selectedContainer));
}

